import React from 'react';
import { AppRegistry } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

import UserRegistrationScreen from './UserRegistrationScreen';
import UserLoginScreen from './UserLoginScreen';
import CreateThreadScreen from './CreateThreadScreen';
import ViewThreadScreen from './ViewThreadScreen';

const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="UserRegistration">
        <Stack.Screen
          name="UserRegistration"
          component={UserRegistrationScreen}
          options={{ title: 'User Registration' }}
        />
        <Stack.Screen
          name="UserLogin"
          component={UserLoginScreen}
          options={{ title: 'User Login' }}
        />
        <Stack.Screen
          name="CreateThread"
          component={CreateThreadScreen}
          options={{ title: 'Create Thread' }}
        />
        <Stack.Screen
          name="ViewThread"
          component={ViewThreadScreen}
          options={{ title: 'View Thread' }}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

AppRegistry.registerComponent('MyApp', () => App);
